import * as api from '../../api/fav_episodes';

export const likeEpisode = (episode, user) => async(dispatch) => {
  try {
    await api.likeEpisode(episode, user);
  } catch (error) {
    console.log(error);
  }
};

export const unlikeEpisode = (episode, user) => async(dispatch) => {
  try {
    api.unlikeEpisode(episode, user);
  } catch (error) {
    console.log(error);
  }
}
